  (152325733930, 'Miners Moss & Ribbed rubber matting 300 x 600mm Heavy grade 2 piece deal', 'Designed to withstand the elements! Miners Moss is constructed of very durable PVC vinyl, using a process called extrusion. In the extrusion process thousands of spaghetti like vinyl loops are formed and shaped into a heavy duty matting.', '46.90', 9, 'New', ''),
  (222539680492, 'DESERT FOX SPIRAL GOLD PANNING MACHINE SINGLE SPEED CAMEL MINING', 'It is as simple as that and so user-friendly that you will be an expert gold panner ten minutes after you have used the Desert Fox Automatic Gold Panning Machine for the first time. Operates on any 12-volt 7-amp DC power source.', '619.00', 9, 'New', ''),
  (122452153256, 'Gold Snuffer, Sniffer Bottle, 1x 1oz Glass Vial, Gold Prospecting, Mining,Sluice', 'The Snuffer Bottle acts as a hand-held vacuum sucking the gold out of your pan when the plastic bottle is squeezed and released. 1X 1oz GLASS VIAL! ONE SNUFFER BOTTLE!', '17.95', 1, 'New', ''),
  (172158454972, '1" Transfer Water Pump Four Stroke Camping Gold Sluice Transportable Petrol 4x4', 'This Jono & Johno transfer pump is designed for easy transportation. It weighs only 7kg making it an ideal pump for gold sluicing, camping, water tank transfers, gardening or any other application that requires regular movement of the pump.', '175.00', 6, 'New', ''),
  (282643231020, 'Heavy Duty Ripstop Canvas LARGE Tool Bag - Adjustable Strap - OLIVE GREEN', '(Blue, Red, Grey, Brown & Bright Green). Heavy Duty. Ripstop Canvas Toolbag. 12 oz Ripstop Canvas. (Olive Green). Adjustable carry strap. Double thickness reinforced base. Internal ''D'' ring for keys/lockout padlock etc.', '93.50', 6, 'New', ''),
