  (252441262951, 'Garrett Gold UPDATED PAN KIT', 'Gold Pan KitNEW UPDATED PAN KIT. 14" Gold Trap™ pan. (includes new Gold Trap Pan). How to Find Gold field guide by Charles Garrett and Roy Lagal.', '65.00', 1, 'New', ''),
  (221707589296, 'Garrett 15" Gold Super Sluice Gold Pan', 'Garrett''s world famous gravity trap gold pan series has led the industry for thirty years. Garrett''s gold pans feature a 90 degree rifled design that ensures safe, sure, rapid gold recovery in wet or dry conditions.', '29.00', 7, 'New', ''),
  (112126599688, '3x Gold Snuffer, Sniffer bottle, 1oz x1 2oz x1, Gold Prospecting, Mining, Sluice', 'The Snuffer Bottle acts as a hand-held vacuum sucking the gold out of your pan when the plastic bottle is squeezed and released. PLUS ONE EACH OF A 1oz & 2oz Glass Vials!', '24.95', 9, 'New', ''),
  (122237523113, 'ROOBUCK USB Rechargeable LED headlight Beanie Hat', 'Colours of hat: Black, Grey, Red. When the LED stays in ‘green’, the charging process is completed and the LED is fully charged. Standard USB 2.0 Interface. LED Charging Indicators as follows When being charged, the LED Light will flash in ‘red’.', '18.00', 5, 'New', ''),
  (161822584042, 'River Sluice gold recovery', 'Sluice, River Sluice. Excellent river sluice for capturing fine and corse gold & gem stones. BEWARE of cheaper overseas designs as you could just be washing your Gold straight off the end and back into the river.', '325.00', 0, 'New', ''),
  (232478373204, 'Mechanical Inclinometer NEIC 8020 (Supplied with Aust Tax Invoice)', 'The 4120 model is designed for easy mounting with two screws, which allows for quick and efficient retrofitting in the field. Oversized inclinometer for easy read. Tamworth NSW 2340. Right hand or left hand models available.', '210.00', 9, 'New', ''),
  (232468311363, 'Panel-Mount Inclinometer HMDS3000 (Supplied with Aust Tax Invoice)', 'The Panel-Mount Inclinometer provides a simple roll only or pitch and roll display for operators. The Panel-Mount inclinometer has been designed as a more versatile replacement for mechanical bubble and ball inclinometers.', '530.00', 0, 'New', ''),
  (162425424199, 'Gold Recovery 3'''' Floating Dredge, Sluice', '3" Floating Dredge Sluice, with 6.5 HP petrol pump, 3" in and out so plenty of power. We custom make sluice boxes and dredges in various sizes, this 3" unit being one of the more popular choices due to the compact size for driving a large 3" dredge nozzle.', '4,500.00', 3, 'New', ''),
  (332359708467, 'Mechanical Slopemeter No 1', 'The Slope Meter No. 1 is used for all slope and crown construction. Slope-Meter No. 1 is widely used on motor graders, bulldozers, and similar equipment. Material: Aluminium Casting Weight (app): 800g.', '523.00', 8, 'New', ''),
  (322766770359, 'high banker', 'Big high banker', '500.00', 1, 'New', ''),
