  (332382225824, 'Inclinometer / Slopemeter 2NS (Supplied with Aust Tax Invoice)', 'Slope-meter No.2NS has a large indicator tube and large numerical scale for easier reading with a quick glance. It is desirable for applications where the Slope-meter is mounted at some distance from the operator.', '495.00', 8, 'New', ''),
  (292258103558, 'Gold Sluice/Dredge/High Banker Combo Mining Fossicking Gems Fine Recovery', 'Tried and tested and designed by a gold mining prospector of over 45 years has built and tested a great variation of bought and built designs of sluices, high bankers and dredges. This is what he has come up with to help you recover more and feel a greater respect for the work and effort you have put into finding your riches.', '1,500.00', 0, 'New', ''),
  (322219309347, 'NEW SELF LEVELING ROTARY ROTATING LASER LEVEL RED BEAM CROSS LINE TRIPOD STAND', 'It projects bright, accurate laser beams in three different ways: Horizontal (Level) Beam; Vertical (Plumb) Beam; Cross Hair (Both Horizontal and Vertical) Beam, perfect for marking out. With a marked 360° rotation base for incremental movement, it is easy to line the entire working area with floor-to-ceiling.', '54.88', 9, 'New', ''),
  (130578601475, 'Baumr-AG Pro Self Levelling Rotary Laser Level Dual Axis w/ Tripod & Hard Case', 'With razor sharp accuracy, line your entire working area with floor-to-ceiling. Those of you that have used older type general laser levels can forget about blurry indistinct lines - the Baumr-AG Dual Axis Series has a >5m indoor working distance and is 360° rotatable with the clearest and brightest lines on the market.', '89.00', 8, 'New', ''),
  (201979345084, '4 In 1 Measuring Tape Ruler Horizon Aligner Multipurpose Laser Level Vertical AU', '4 In 1 Multipurpose Laser Level Horizontal Vertical Line 8FT Measure Tape Ruler Aligner. New Laser Level Horizon Vertical Measure Tape 8FT Aligner. Combines a fine-tuned tape measure, a triple-positioned leveling bubble and a new laser level to provide maximum results.', '13.00', 2, 'New', ''),
